import React from "react";
import styled from "styled-components";

const HomeTitle = () => {
    return (
        <Wrapper>
          <p className="title">홈</p>
          <button className="btn-others" >
            다음 유저의 북마크 보기
          </button>
        </Wrapper>
    );
};

export default HomeTitle;

const Wrapper = styled.div`
padding-left: 170px;
padding-right: 170px;
.title{
  color: #212529;
  font-size: 32px;
  font-family: 'Pret-Bold';
  font-weight: 700;
  line-height: 46px;
  word-wrap: break-word;
}
.btn-others{
  width: 224px; height: 100%; padding-left: 24px; padding-right: 24px; padding-top: 16px; padding-bottom: 16px; 
  background: white; border-radius: 14px; border: 1px #7749F8 solid; justify-content: center; 
  align-items: center; gap: 8px; display: inline-flex";
  color: #6610F2;
  font-size: 16px;
  font-family: 'Pret-Bold';
  font-weight: 700;
  line-height: 24px;
  word-wrap: break-word;
}
`
